export async function getGistData() {
    const data = {
        "collection": "work",
        "database": "resume-mdb",
        "dataSource": "Cluster0",
        "projection": {
            "_id": "6233c41fb6d482006174091f"
        }
    };
    try {
        const url = `https://data.mongodb-api.com/app/data-idhmq/endpoint/data/beta/action/findOne`
        const response = await fetch(url, {
            method: 'POST',
            mode: 'no-cors',
            headers: {
                'Content-Type' : 'application/json',
                'Access-Control-Request-Headers' : '*',
                'api-key' : `'uPwkjrBBvHDVJmaVbjXkKZjWLFVRWL2BeZ3yUFsXafaDCQv40UUVej6w5Rm86QvP'`
            },
            body: JSON.stringify(data)
        });

        return await response.json()
    } catch (error) {
        return [];
    }
}
